#include<unordered_set>
#include<iostream>
#include<vector>
#include<stack>
using namespace std;


class Solution {
public:
    void solve(vector<vector<char>> &board) {
        if(board.size()<3||board[0].size()<3)
            return;
        vector<vector<char> > cpboard(board.size(),vector<char>(board[0].size(),'X'));
        //unordered_set<int> valid;
        //valid.clear();
        int row=board.size()-1;
        int col=board[0].size()-1;
        for(int i=0;i<board[0].size();i++){
            if(board[0][i]=='O'){
                val(0,i,board,cpboard);
            }
            if(board[row][i]=='O'){
                val(row,i,board,cpboard);
            }
        }
        for(int i=1;i<row;i++){
            if(board[i][0]=='O')
                val(i,0,board,cpboard);
            if(board[i][col]=='O')
                val(i,col,board,cpboard);
        }
        board.clear();
        board=cpboard;
        // int index=0;
        // for(int i=0;i<=row;i++){
        //     for(int j=0;j<=col;j++){
        //         if(board[i][j]=='O'&&valid.find(index)==valid.end())
        //             board[i][j]='X';
        //         index++;
        //     }
        // }
        return;
    }

    void val(const int& row, const int& col, vector<vector<char>> &board, vector<vector<char> > &cpboard){
        int rowmax=board.size()-1;
        int colmax=board[0].size()-1;
        stack<pair<int,int>> stk;
        stk.push(pair<int,int>(row,col));
        //unsigned int index=row*board[0].size();
        //if(valid.find(index+col)!=valid.end()) return;
        //valid;
        while(stk.size()>0){
            int row=stk.top().first;
            int col=stk.top().second;
            stk.pop();

            cpboard[row][col]='O';
            //cout<<row<<'\t'<<col<<'\t'<<board[row][col]<<endl;
            if(row>0){
                if(board[row-1][col]=='O')
                    if(cpboard[row-1][col]=='X'){
                        //valid.insert(index-board[0].size()+col);
                        stk.push(pair<int,int>(row-1,col));
                    }
            }
            if(row<rowmax){
                if(board[row+1][col]=='O')
                    if(cpboard[row+1][col]=='X'){
                        //valid.insert(index+board[0].size()+col);
                        //val(row+1,col,board,cpboard);
                        stk.push(pair<int,int>(row+1,col));
                    }
            }
            if(col>0){
                if(board[row][col-1]=='O')
                    if(cpboard[row][col-1]=='X'){
                        //valid.insert(index+col-1);
                        //val(row,col-1,board,cpboard);
                        stk.push(pair<int,int>(row,col-1));
                    }
            }
            if(col<colmax){
                if(board[row][col+1]=='O')
                    if(cpboard[row][col+1]=='X'){
                        //valid.insert(index+col+1);
                        //val(row,col+1,board,cpboard);
                        stk.push(pair<int,int>(row,col+1));
                    }
            }
        }
    }
};
